import React from "react";

function Footer() {
  return (
    <footer className="bg-blue-500 p-4 mt-8">
      <div className="container mx-auto text-white text-center">
        &copy; {new Date().getFullYear()} Your Company. All Rights Reserved.
      </div>
    </footer>
  );
}

export default Footer;
